
    <!DOCTYPE html>
    <html lang="en">
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <title>Interactive Logit Lens</title>
        <style>
            body { margin: 0; padding: 0; font-family: Arial, sans-serif; }
            .container { display: flex; }
            .image-container { 
                flex: 0 0 auto; 
                margin: 20px; 
                position: relative;
            }
            .highlight-box {
                position: absolute;
                border: 2px solid red;
                pointer-events: none;
                display: none;
            }
            .table-container { 
                flex: 1 1 auto;
                position: relative;
                max-height: 90vh;
                overflow: auto;
                margin: 20px;
            }
            table { 
                border-collapse: separate;
                border-spacing: 0;
            }
            th, td { 
                border: 1px solid #ddd; 
                padding: 8px; 
                text-align: center;
                min-width: 80px;
            }
            th { 
                background-color: #f2f2f2; 
                font-weight: bold;
            }
            .corner-header {
                position: sticky;
                top: 0;
                left: 0;
                z-index: 3;
                background-color: #f2f2f2;
            }
            .row-header {
                position: sticky;
                left: 0;
                z-index: 2;
                background-color: #f2f2f2;
            }
            .col-header {
                position: sticky;
                top: 0;
                z-index: 1;
                background-color: #f2f2f2;
            }
            #tooltip {
                display: none;
                position: fixed;
                background: white;
                border: 1px solid black;
                padding: 5px;
                z-index: 1000;
                pointer-events: none;
                max-width: 300px;
                font-size: 14px;
            }
        </style>
    </head>

        </script>
